"use strict";(self.webpackChunkjohnycho_dev=self.webpackChunkjohnycho_dev||[]).push([[9916],{4612:s=>{s.exports=JSON.parse('{"tag":{"label":"Computer Science","permalink":"/docs/tags/cs","description":"Computer Science tag description","allTagsPath":"/docs/tags","count":21,"items":[{"id":"cs/cs-network-timeout","title":"Connection Timeout, Socket Timeout, Read Timeout\uc758 \ucc28\uc774\uc810","description":"\u2714\ufe0f Connection Timeout","permalink":"/docs/cs/cs-network-timeout"},{"id":"cs/cs-cors","title":"CORS(Cross Origin Resource Sharing)","description":"CORS(Cross Origin Resource Sharing)\ub294 \ucd9c\ucc98\uac00 \ub2e4\ub978 \uacf3\uc758 \ub9ac\uc18c\uc2a4\ub97c \uc694\uccad\ud560 \ub54c \uc811\uadfc \uad8c\ud55c\uc744 \ubd80\uc5ec\ud558\ub294 \uba54\ucee4\ub2c8\uc998\uc785\ub2c8\ub2e4. \ub9ac\uc18c\uc2a4\ub97c \uc8fc\uace0\ubc1b\ub294 \ub450 \uacf3\uc758 \ucd9c\ucc98\uac00 \ub2e4\ub974\uba74 \ucd9c\ucc98\uac00 \uad50\ucc28\ud55c\ub2e4\uace0 \ud569\ub2c8\ub2e4. \uc774\ub54c \ucd9c\ucc98\ub294 URL\ubfd0\ub9cc \uc544\ub2c8\ub77c \ud504\ub85c\ud1a0\ucf5c\uacfc \ud3ec\ud2b8\uae4c\uc9c0 \ud3ec\ud568\ub429\ub2c8\ub2e4. \ub9cc\uc57d \ud074\ub77c\uc774\uc5b8\ud2b8\uc758 \ucd9c\ucc98\uac00 \ud5c8\uc6a9\ub418\uc9c0 \uc54a\uc558\ub2e4\uba74 CORS \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-cors"},{"id":"cs/cs-http-https","title":"HTTP vs HTTPS","description":"\u2714\ufe0f HTTP(Hypertext Transfer Protocol)","permalink":"/docs/cs/cs-https"},{"id":"cs/cs-http-method-idempotency","title":"HTTP \uba54\uc11c\ub4dc\uc758 \uba71\ub4f1\uc131","description":"\uc5f0\uc0b0\uc744 \uc5ec\ub7ec \ubc88 \uc801\uc6a9\ud558\ub354\ub77c\ub3c4 \uacb0\uacfc\uac00 \ub2ec\ub77c\uc9c0\uc9c0 \uc54a\ub294 \uc131\uc9c8\uc744 \uba71\ub4f1\uc131\uc774\ub77c\uace0 \ud569\ub2c8\ub2e4. HTTP \uba54\uc11c\ub4dc\uc758 \uba71\ub4f1\uc131\uc740 \ub3d9\uc77c\ud55c \uc694\uccad\uc744 \ud55c\ubc88 \ubcf4\ub0b4\ub294 \uac83\uacfc \uc5ec\ub7ec\ubc88 \ubcf4\ub0b4\ub294 \uac83\uc774 \uc11c\ub85c \ub3d9\uc77c\ud55c \ud6a8\uacfc\ub97c \uc9c0\ub2c8\uba70, \uc11c\ubc84\uc758 \uc0c1\ud0dc\ub3c4 \ub3d9\uc77c\ud558\uac8c \ub0a8\uc744 \uacbd\uc6b0\uc5d0 \uba71\ub4f1\ud558\ub2e4\uace0 \uc774\uc57c\uae30\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub300\ud45c\uc801\uc73c\ub85c \uba71\ub4f1\ud55c \uba54\uc11c\ub4dc\ub294 GET, HEAD, PUT, DELETE, TRACE, OPTIONS \uac00 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-http-method-idempotency"},{"id":"cs/cs-tcp-3-way-handshake","title":"TCP 3-way handshake","description":"3-way handshake","permalink":"/docs/cs/cs-tcp-3-way-handshake"},{"id":"cs/cs-solid-principle","title":"\uac1d\uccb4\uc9c0\ud5a5 \uc124\uacc4 5\uc6d0\uce59(SOLID)","description":"SOLID \uc6d0\uce59\uc740 \uac1d\uccb4\uc9c0\ud5a5 \uc124\uacc4 5\uc6d0\uce59\uc774\ub77c\uace0\ub3c4 \ubd88\ub9ac\uba70, \uac01 \uc6d0\uce59\uc758 \uc55e \uae00\uc790\ub97c \ub530\uc11c \ub9cc\ub4e4\uc5b4\uc84c\uc2b5\ub2c8\ub2e4. \uac1d\uccb4\uc9c0\ud5a5\uc124\uacc4\uc758 \ud575\uc2ec \uc911 \ud558\ub098\ub294 \uc758\uc874\uc131\uc744 \uad00\ub9ac\ud558\ub294 \uac83\uc778\ub370\uc694. \uc758\uc874\uc131\uc744 \uc798 \uad00\ub9ac\ud558\uae30 \uc704\ud574\uc11c\ub294 SOLID \uc6d0\uce59\uc744 \uc900\uc218\ud574\uc57c \ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-solid-principle"},{"id":"cs/cs-session-based-authentication","title":"\ub2e4\uc911 \uc11c\ubc84 \ud658\uacbd\uc758 \uc138\uc158 \uae30\ubc18 \uc778\uc99d \ubc29\uc2dd","description":"\ub2e4\uc911 \uc11c\ubc84 \ud658\uacbd\uc5d0\uc11c \uc138\uc158 \uae30\ubc18 \uc778\uc99d \ubc29\uc2dd\uc744 \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \uc138\uc158 \ubd88\uc77c\uce58 \ubb38\uc81c\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub9cc\uc57d \uc11c\ubc84 A, B\ub97c \uad00\ub9ac\ud558\uace0 \uc788\uc744 \ub54c, \ub85c\ub4dc\ubc38\ub7f0\uc11c\ub294 \uc0ac\uc6a9\uc790\uc758 \uc694\uccad\uc744 \uc0c1\ud669\uc5d0 \ub9de\uac8c A, B \uc911 \ud55c \uacf3\uc73c\ub85c \uc804\ub2ec\ud569\ub2c8\ub2e4. \uc720\ud6a8\ud55c \ub85c\uadf8\uc778 \uc694\uccad\uc774 A \uc11c\ubc84\ub85c \ucc98\uc74c \ub3c4\ucc29\ud558\uba74 \uc0ac\uc6a9\uc790\uc5d0 \ub300\ud55c \uc138\uc158 \uc815\ubcf4\ub294 A \uc11c\ubc84\uc5d0 \uc800\uc7a5\ub429\ub2c8\ub2e4. \uc774\ud6c4\uc5d0 \ud574\ub2f9 \uc0ac\uc6a9\uc790\uc758 \ub610 \ub2e4\ub978 \uc694\uccad\uc774 \ub85c\ub4dc \ubc38\ub7f0\uc11c\uc5d0 \ub3c4\ucc29\ud588\uc744 \ub54c, B \uc11c\ubc84\ub85c \ub3c4\ucc29\ud558\uac8c \ub418\uba74 \uc0ac\uc6a9\uc790\uc758 \uc138\uc158 \ub370\uc774\ud130\uac00 \uc874\uc7ac\ud558\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \uc694\uccad\uc774 \uc81c\ub300\ub85c \ucc98\ub9ac\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uc774\ub97c \uc138\uc158 \ubd88\uc77c\uce58 \ubb38\uc81c\ub77c\uace0 \ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-session-based-authentication"},{"id":"cs/cs-unit-integration-test","title":"\ub2e8\uc704 \ud14c\uc2a4\ud2b8\uc640 \ud1b5\ud569 \ud14c\uc2a4\ud2b8","description":"\ub2e8\uc704 \ud14c\uc2a4\ud2b8","permalink":"/docs/cs/cs-unit-integration-test"},{"id":"cs/cs-sync-async-blocking-non-blocking","title":"\ub3d9\uae30 vs \ube44\ub3d9\uae30, \ube14\ub85c\ud0b9 vs \ub17c\ube14\ub85c\ud0b9","description":"\ud638\ucd9c\ud558\ub294 \ud568\uc218\uc758 \uc791\uc5c5 \uc644\ub8cc\ub97c \uae30\ub2e4\ub9ac\ub294\uc9c0 \uc5ec\ubd80\uc758 \ucc28\uc774\uac00 \uc788\uc2b5\ub2c8\ub2e4. \ud568\uc218 A\uac00 \ub3d9\uae30\ub85c \ud568\uc218 B\ub97c \ud638\ucd9c\ud558\uba74 A\ub294 B\uc758 \uc791\uc5c5\uc774 \uc644\ub8cc\ub420 \ub54c\uae4c\uc9c0 \uae30\ub2e4\ub824\uc57c \ud569\ub2c8\ub2e4. \ub530\ub77c\uc11c \uc791\uc5c5\uc774 \uc21c\ucc28\uc801\uc73c\ub85c \uc9c4\ud589\ub429\ub2c8\ub2e4. \ubc18\uba74, \ud568\uc218 A\uac00 \ube44\ub3d9\uae30\ub85c \ud568\uc218 B\ub97c \ud638\ucd9c\ud558\uba74 A\ub294 B\uc758 \uc791\uc5c5 \uc644\ub8cc\ub97c \uc2e0\uacbd \uc4f0\uc9c0 \uc54a\uace0 \ub530\ub85c \ub3d9\uc791\ud569\ub2c8\ub2e4. \ub530\ub77c\uc11c \uc791\uc5c5\uc774 \uc21c\ucc28\uc801\uc73c\ub85c \uc9c4\ud589\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-sync-async-blocking-non-blocking"},{"id":"cs/cs-concurrency-and-parallelism","title":"\ub3d9\uc2dc\uc131\uacfc \ubcd1\ub82c\uc131","description":"Concurrency and Parallelism","permalink":"/docs/cs/cs-concurrency-and-parallelism"},{"id":"cs/cs-log-and-metric","title":"\ub85c\uadf8\uc640 \uba54\ud2b8\ub9ad","description":"\u2714\ufe0f \ub85c\uadf8","permalink":"/docs/cs/cs-log-and-metric"},{"id":"cs/cs-load-balancing","title":"\ub85c\ub4dc \ubc38\ub7f0\uc2f1","description":"\ub85c\ub4dc \ubc38\ub7f0\uc2f1\uc774\ub780 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uc9c0\uc6d0\ud558\ub294 \ub9ac\uc18c\uc2a4 \ud480\uc5d0 \ub4e4\uc5b4\uc624\ub294 \ub124\ud2b8\uc6cc\ud06c \ud2b8\ub798\ud53d(\ub4e4\uc5b4\uc624\ub294 \uc694\uccad)\uc744 \uade0\ub4f1\ud558\uac8c \ubd84\uc0b0\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub97c \uc218\ud589\ud558\ub294 \ub85c\ub4dc \ubc38\ub7f0\uc11c\ub294 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \uc11c\ubc84 \uc55e\ub2e8\uc5d0 \uc704\uce58\ud558\uba70 \ud074\ub77c\uc774\uc5b8\ud2b8 \uc694\uccad\uc744 \uc9c0\uc2dc\ud558\uace0 \uc81c\uc5b4\ud569\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574\uc11c \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc758 \uac00\uc6a9\uc131, \ud655\uc7a5\uc131, \ubcf4\uc548 \ubc0f \uc131\ub2a5\uc744 \ud655\ubcf4\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-load-balancing"},{"id":"cs/cs-proxy","title":"\ub9ac\ubc84\uc2a4 \ud504\ub85d\uc2dc\uc640 \ud3ec\uc6cc\ub4dc \ud504\ub85d\uc2dc\uc758 \ucc28\uc774\uc810","description":"\u2714\ufe0f \ud3ec\uc6cc\ub4dc \ud504\ub85d\uc2dc(Forward Proxy)","permalink":"/docs/cs/cs-proxy"},{"id":"cs/cs-ssr-and-csr","title":"\uc11c\ubc84 \uc0ac\uc774\ub4dc \ub80c\ub354\ub9c1(SSR)\uacfc \ud074\ub77c\uc774\uc5b8\ud2b8 \uc0ac\uc774\ub4dc \ub80c\ub354\ub9c1(CSR)","description":"\u2714\ufe0f \uc11c\ubc84 \uc0ac\uc774\ub4dc \ub80c\ub354\ub9c1(SSR)","permalink":"/docs/cs/cs-ssr-and-csr"},{"id":"cs/cs-computing-resources","title":"\uc2a4\ub808\ub4dc, \ud504\ub85c\uc138\uc2a4, \ucf54\uc5b4\uc758 \uc218\ub294 \ub9ce\uc744 \uc218\ub85d \uc88b\uc744\uae4c?","description":"\uc2a4\ub808\ub4dc, \ud504\ub85c\uc138\uc2a4, \ucf54\uc5b4\uc758 \uc218\uac00 \ub9ce\uc744\uc218\ub85d \uc2dc\uc2a4\ud15c \uc131\ub2a5\uc774 \ud5a5\uc0c1\ub41c\ub2e4\uace0 \uc0dd\uac01\ud560 \uc218 \uc788\uc9c0\ub9cc, \uc2e4\uc81c\ub85c\ub294 \uadf8\ub807\uc9c0 \uc54a\uc744 \ud655\ub960\uc774 \ud07d\ub2c8\ub2e4.","permalink":"/docs/cs/cs-computing-resources"},{"id":"cs/cs-stack-queue","title":"\uc2a4\ud0dd \uc790\ub8cc\uad6c\uc870","description":"\u2714\ufe0f \uc2a4\ud0dd(Stack)","permalink":"/docs/cs/cs-stack-queue"},{"id":"cs/cs-third-party-sync-failure","title":"\uc678\ubd80 API \uc7a5\uc560 \ub300\uc751","description":"\uc678\ubd80 \uc11c\ube44\uc2a4 \uc7a5\uc560\ub85c \uc778\ud574 \uc751\ub2f5\uc774 \uc624\ub798 \uac78\ub9b0\ub2e4\uace0 \ud588\uc744 \ub54c, \uc678\ubd80 API \uc751\ub2f5\uc73c\ub85c \ub300\uae30\ud558\ub294 \uc790\uc6d0\ub4e4\uc774 \uc6b4\uc601 \uc11c\ubc84 \ub0b4\ubd80\uc5d0 \uc313\uc774\uba74\uc11c \uc131\ub2a5\uc5d0 \uc545\uc601\ud5a5\uc744 \uc904 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud55c \uac00\uc7a5 \uae30\ubcf8\uc801\uc778 \ubc29\ubc95\uc740 \ud0c0\uc784\uc544\uc6c3\uc744 \uc124\uc815\ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \ud06c\uac8c \ud0c0\uc784\uc544\uc6c3\uc5d0\ub294 \ucee4\ub125\uc158 \ud0c0\uc784\uc544\uc6c3\uacfc \ub9ac\ub4dc \ud0c0\uc784\uc544\uc6c3, HTTP \ucee4\ub125\uc158 \ud480 \ud0c0\uc784\uc544\uc6c3\uc744 \uc124\uc815\ud574 \ubcfc \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-third-party-sync-failure"},{"id":"cs/cs-web-process","title":"\uc6f9 \ube0c\ub77c\uc6b0\uc800\uc5d0 URL \uc785\ub825\ud558\uba74 \uc77c\uc5b4\ub098\ub294 \uc77c","description":"\uc608\ub97c \ub4e4\uc5b4 \uc0ac\uc6a9\uc790\uac00 www.google.com\uc744 \uc785\ub825\ud558\uba74, \ube0c\ub77c\uc6b0\uc800\ub294 HTTP \ud504\ub85c\ud1a0\ucf5c\uc744 \uc0ac\uc6a9\ud574 \uad6c\uae00 \uc6f9 \uc11c\ubc84\uc640 \ud1b5\uc2e0\ud558\ub824\uace0 \ud569\ub2c8\ub2e4. HTTP\ub294 OSI 7\uacc4\uce35 \uc911 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \uacc4\uce35\uc5d0\uc11c \ub3d9\uc791\ud558\ub294 \ud504\ub85c\ud1a0\ucf5c\uc785\ub2c8\ub2e4.","permalink":"/docs/cs/cs-web-process"},{"id":"cs/cs-ws-vs-was","title":"\uc6f9 \uc11c\ubc84\uc640 WAS(Web Application Server)","description":"\u2714\ufe0f \uc6f9 \uc11c\ubc84 (Web Server)","permalink":"/docs/cs/cs-ws-vs-was"},{"id":"cs/cs-first-class-collection","title":"\uc77c\uae09 \uceec\ub809\uc158","description":"\ud558\ub098\uc758 \uceec\ub809\uc158\uc744 \uac10\uc2f8\ub294 \ud074\ub798\uc2a4\ub97c \ub9cc\ub4e4\uace0, \ud574\ub2f9 \ud074\ub798\uc2a4\uc5d0\uc11c \uceec\ub809\uc158\uacfc \uad00\ub828\ub41c \ube44\uc988\ub2c8\uc2a4 \ub85c\uc9c1\uc744 \uad00\ub9ac\ud558\ub294 \ud328\ud134\uc744 \ub9d0\ud569\ub2c8\ub2e4. \uc544\ub798 \ucf54\ub4dc \uc911\uc5d0\uc11c Order\uc758 List \uc790\ub8cc\uad6c\uc870\ub97c \uac10\uc2fc Orders\uac00 \uc77c\uae09 \uceec\ub809\uc158\uc758 \uc608\uc2dc\uc785\ub2c8\ub2e4.","permalink":"/docs/cs/cs-first-class-collection"},{"id":"cs/cs-caching-strategy","title":"\uce90\uc2f1 \uc804\ub7b5","description":"\uce90\uc2dc\ub294 \uc131\ub2a5 \ud5a5\uc0c1\uacfc \ubd80\ud558 \uac10\uc18c\ub97c \ubaa9\ud45c\ub85c \ud569\ub2c8\ub2e4. \uc774\ub54c \uce90\uc2dc\ub97c \uc0ac\uc6a9\ud558\ub294 \uc591\uc0c1\uc774 \uc11c\ube44\uc2a4\uc5d0 \ud070 \uc601\ud5a5\uc744 \ub07c\uce58\uae30\ub3c4 \ud569\ub2c8\ub2e4. \ub530\ub77c\uc11c, \uce90\uc2f1 \uc804\ub7b5\uc744 \uc774\ud574\ud558\ub294 \uac83\uc740 \uc911\uc694\ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-caching-strategy"}],"unlisted":false}}')}}]);